import Populares from "./Populares";
import SearchForm from "../components/SearchForm/SearchForm";


const Home = (props) => {

    return(
        <>
            <Cartelera/>
            <Populares/>
            <SearchForm history= {props.history} />
            <Populares />
            <Cartelera />
        </>
    )

}

export default Home
